import Vue from "vue";
import Vuex from "vuex";
Vue.use(Vuex);


export const store = new Vuex.CreateStore({
    state: {
        searchString: "",
    },
    getters: {
        getSearchString(state) {
            return state.searchString;
        }
    },
    // State verisini güncelleme
    mutations: {
        setSearcheString: (state, searchString) => {
            state.searchString = searchString;
            return state.searchString;
        }
    },
    actions: {}
});
